import './App.css';

function App() {
  return (
    <div className="App">
      <audio id="audio" loop autoplay> 
        <source src="%PUBLIC_URL%/music.mp3" type="audio/mpeg"/>
      </audio>
      <header className="App-header">
        <h1>New Blood Joins This Earth</h1>
        <h4>A retrospective on the Metallica Blacklist</h4>
      </header>
    </div>
  );
}

export default App;
